import React, { Component } from 'react'
import { Link, NavLink } from 'react-router-dom'

export default class NavBar extends Component {
    render() {
        return (
            <div>
                <ul>
                    <Link to="/laderBoard"></Link>
                    {/* <li>Leader Board</li> */}
                    <li>Login</li>
                    <li id='user'>Current User</li>
                </ul>
            </div>
        )
    }
}
